import React from 'react';
import facebook from './images/facebook.png';
import email from './images/email.png';
import instagram from './images/instagram.png';
import website from './images/website.png';

import './style.css';

const CompanyContactComp = (props) => {
    return (
        <div className="companyDescription">
            <h3>Para Design</h3>
            <h4>Passion to innovate</h4>
            <h5> <img src={facebook} alt="facebook" /> /paradesign</h5>
            <h5><img src={email} alt="email" />  paradesign@gmail.uk</h5>
            <img src={instagram} alt="instagram" /> <h5> paradesign</h5>
            <img src={website} alt="website" /> <h5> www.paradesign.uk</h5>

        </div>
    )
}

export default CompanyContactComp;
